INSERT INTO `reports` VALUES (353,1,'Hastanın yapılan muayenesinde vizyonu tashihle sağda 3-4/10, solda 3/10;\nBiomikroskopik muayenesinde sağda arka subkapsüller katarakt başlangıcı bilateral minimal punktat kesafeti izlenmiştir. Yüksek astigmatizma ve myopi mevcuttur.','2023-01-21','H52.2 Astigmatizma, H53.0 Anopsisiz Ambliyobi',24),(354,2,'Hasta, bulanık görme, renklerde solma ve gece görüşünde zorluk şikayetleri ile başvurdu. Yapılan muayene sonucunda, her iki gözünde katarakt tespit edildi. Katarakt cerrahisi önerildi.','2022-11-12','Katarakt',24),(402,53,'Hasta, göz içi basıncında artışa bağlı olarak optik sinir hasarı ve görme alanı kaybı şikayetleri ile başvurdu. Göz içi basınç ölçümleri ve görme alanı testleri sonucunda, hastaya glokom tanısı konuldu. Medikal tedavi ve düzenli takip önerildi.','2023-11-15','Glokom',24),(403,102,'Hasta, ani görme kaybı ve ışıkların yanıp sönmesi şikayetleri ile acil servise başvurdu. Fundus muayenesi ve retina görüntüleme testleri sonucunda, retina ayrılması tespit edildi. Acil cerrahi müdahale önerildi.','2023-08-22','Retina Ayrılması',24),(602,103,'Retina damarlarında mikrovasküler değişiklikler gözlemlenmiş, damar sızıntıları ve makula ödemi gibi retinopatinin belirtileri tespit edilmiştir.Şeker kontrolünün sağlanması, lazer tedavisi ve intravitreal ilaç enjeksiyonları gibi yöntemlerle retinopatinin ilerlemesini durdurma ve görme kaybını önleme amaçlanmıştır.','2024-01-01','Şeker Hastalığına Bağlı Retinopati',24),(603,152,'Meme kanseri, mamografi, ultrason, biyopsi ve diğer görüntüleme testleri kullanılarak teşhis edilir. Patolojik inceleme sonucunda kanser hücreleri belirlenir.Tümör boyutu, lenf nodu tutulumu ve tümör hücrelerinin biyopsi sonuçları gibi faktörlere göre kanserin evresi belirlenir.','2023-05-10','Meme Kanseri',19),(604,153,'Akciğer kanseri genellikle görüntüleme testleri (BT, PET taraması), bronkoskopi ve biyopsi ile teşhis edilir.\nKanserin tipi (örneğin, küçük hücreli dışı hücreli akciğer kanseri), tümör boyutu, metastaz durumu ve lenf nodu tutulumu gibi faktörlere göre evreleme yapılır.Tedavi, cerrahi (örneğin, lobektomi), radyoterapi, kemoterapi ve hedefe yönelik tedavileri içerebilir.','2022-10-09','Akciğer Kanseri',19),(605,53,'Plevra efüzyonu, göğüs boşluğundaki seröz sıvının artmasıdır. Göğüs röntgeni, bilgisayarlı tomografi (BT) veya ultrason gibi görüntüleme testleri kullanılarak teşhis edilir.\nEffüzyonun nedeni belirlenir, örneğin kanser, enfeksiyon veya kalp yetmezliği gibi altta yatan bir hastalığa bağlı olabilir.','2021-10-27','Plevra Efüzyonu',19),(606,2,'Atopik dermatit genellikle klinik muayene ve hastanın öyküsüne dayanarak konulur. Kızarıklık, kaşıntı ve ciltte kuruluk belirtileri gözlemlenir.\nCilt biyopsisi yapılmadan da tanı konabilir. Hastanın atopik dermatite yatkınlığı ve alerjik reaksiyonları değerlendirilir.','2024-01-02','Atopik Dermatit (Egzama)',18),(607,154,'Psoriasis genellikle cilt lezyonlarının tipik görünümüne dayanarak konulur. Cilt biyopsisi nadiren yapılır. Psoriasis lezyonları genellikle kırmızı, kalın derili plaklar şeklindedir. Tipik olarak sedef pulları ile kaplıdır. Tedavi, topikal kortikosteroidler, D vitamin analogları, fototerapi ve sistemik ilaçları içerebilir.','2023-01-24','Psoriasis',18),(608,1,'Küfe yönelik mevcut bir alerji varsa, küf içeren gıdaların tüketimi gıda alerjisi gibi görünen semptomlara neden olabilir. \n\nBazı gıdalarla ilgili, bu gıda bozulmuş gibi görünmeksizin saprofit formunda mantarlarla hafif kolonileşme ortaya çıkabilir. Bu gibi durumlarda gıda maddesinin özellikleri (şeker içeriği, tutarlılığı, doğal mantar öldürücü içeriği) ve de nem içeriği rol oynar. Gıdanın kurutulması veya susuzlaştırılması (örneğin tütsüleme) bu sebepten ötürü önemli bir koruma biçimidir. Risk, mantar öldürücü tedavi yokluğuna bağlı olarak organik ürünlerde gerçekte artmaktadır.\n','2023-03-19','Küf Alerjisi',18),(609,155,'Koroner arter hastalığı genellikle anjina belirtileri, elektrokardiyografi (EKG), stres testi ve koroner anjiyografi gibi testlerle teşhis edilir.\nKoroner arterlerde daralma veya tıkanıklıkların varlığı, anjiyografi sırasında görülebilir. EKG\'de miyokard enfarktüsü belirtileri gözlenebilir.\nTedavi, medikal yönetim (ilaç tedavisi), anjiyoplasti, stent yerleştirme veya koroner arter baypas cerrahisi gibi prosedürleri içerebilir.','2023-09-30','Koroner Arter Hastalığı (KAH)',25),(610,154,'Aort anevrizması genellikle görüntüleme testleri, özellikle bilgisayarlı tomografi (BT) veya manyetik rezonans görüntüleme (MRG) ile teşhis edilir.\nAortun belirli bir bölgesinde arter duvarında genişleme veya balonlaşma tespit edilir.\nTedavi, anevrizmanın büyüklüğüne, konumuna ve hastanın durumuna bağlı olarak cerrahi müdahale veya takip içerebilir.','2023-11-07','Aort Anevrizması',25),(611,102,'Kalp kapak hastalıkları genellikle fonksiyonel testler, ekokardiyografi ve kardiyak kateterizasyon gibi testlerle teşhis edilir.\nKalp kapaklarında stenoz (daralma) veya yetmezlik (kaçak) belirtileri gözlemlenir. Kan akışı, kapaklardaki anormalliklere bağlı olarak değerlendirilir.\nTedavi, ilaç yönetimi, kapak onarımları veya kapak replasmanı gibi cerrahi müdahaleleri içerebilir.','2023-05-10','Kalp Kapak Hastalıkları',25),(612,1,'Atriyal fibrilasyon genellikle elektrokardiyografi (EKG), Holter monitorizasyonu veya event monitoru gibi kardiyak izleme araçları kullanılarak teşhis edilir.\nEKG\'de düzensiz kalp atışları, atriyal fibrilasyonun belirgin bir göstergesidir. Holter monitorizasyonu, aralıklı AFib ataklarını yakalayabilir.\nTedavi, antikoagülanlar (kan sulandırıcılar), antiaritmik ilaçlar ve bazen ablasyon prosedürleri gibi yöntemleri içerebilir. Tedavi planı, hastanın semptomları, yaş, sağlık durumu ve diğer faktörlere bağlı olarak belirlenir.','2023-07-10','Atriyal Fibrilasyon (AFib)',25);
